                                        <MDBIcon icon='chart-pie' />
                                    </div>
                                    <p className='white-text'>TRAFFIC</p>
                                    <h4>20000</h4>
                                </MDBCardBody>

                                <MDBProgress
                                    value={75}
                                    barClassName='bg grey darken-3'
                                    height='6px'
                                    wrapperStyle={{ opacity: '.7' }}
                                />

                                <MDBCardBody>
                                    <p>Better than last week (25%)</p>
                                </MDBCardBody>
                            </MDBCard>
                        </MDBCol>

                        <MDBCol xl='3' md='6' className='mb-4'>
                            <MDBCard
                                color='red accent-2'
                                className='classic-admin-card white-text'
                            >
                                <MDBCardBody>
                                    <div className='float-right'>
                                        <MDBIcon icon='chart-bar' />
                                    </div>
                                    <p className='white-text'>ORGANIC TRAFFIC</p>
                                    <h4>2000</h4>
                                </MDBCardBody>

                                <MDBProgress
                                    value={25}
                                    barClassName='bg grey darken-3'
                                    height='6px'
                                    wrapperStyle={{ opacity: '.7' }}
                                />

                                <MDBCardBody>
                                    <p>Better than last week (25%)</p>
                                </MDBCardBody>
                            </MDBCard>
                        </MDBCol>
                    </MDBRow>
                </section>
                {/* <MDBBtnFixed
                    onMouseEnter={this.onHover}
